import React from 'react'
import './LoginHeader.css';
import { Link } from 'react-router-dom';

function LoginHeader() {
    return (
        <div className='header'>
            <Link className='link' to='/' />
            <img src="https://image.shutterstock.com/shutterstock/photos/1025508634/display_1500/stock-vector-jazz-saxophone-player-vector-illustration-for-jazz-poster-1025508634.jpg" alt='Jazz Social' className='header_logo' />

            <Link className='register' to='/register' />
                <button className='header_button'>Create New Account</button>
        </div>
    )
}

export default LoginHeader
